const Grid = () => {
  return (
    <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
      <Card title="P1" imgSrc="assets/images/colorwar.png" imgAlt="PP1"></Card>
      <Card title="P2" imgSrc="assets/images/colorwar.png" imgAlt="PP2"></Card>
      <Card title="P3" imgSrc="assets/images/colorwar.png" imgAlt="PP3"></Card>
      <Card title="P4" imgSrc="assets/images/colorwar.png" imgAlt="PP4"></Card>
      <Card title="P5" imgSrc="assets/images/colorwar.png" imgAlt="PP5"></Card>
      <Card title="P6" imgSrc="assets/images/colorwar.png" imgAlt="PP6"></Card>
    </div>
  );
};

export default Grid;
